import React, { useEffect, useState } from "react";
import { Helmet, HelmetProvider } from "react-helmet-async";
import { useParams } from "react-router-dom";
import Axios from "axios";

import { Container, Row, Col, Tabs, Tab, Badge } from "react-bootstrap";

function SpiceINLanding() {
  return (
    <div>
      <HelmetProvider>
        <Helmet>
          <title>Partner | Zom-IN</title>
        </Helmet>
      </HelmetProvider>
      <Container className="content mt-2">
        <Row>
          <Col sm={12} md={9} lg={9}>
            <div className="text-center mx-auto px-lg-0 px-md-4 px-0">
              <img
                src="assets/img/articles/article-1.png"
                class="img-fluid mx-auto border"
                alt="Spice-In"
              />
            </div>

            <div className="text-center mx-auto px-lg-0 px-md-4 px-0">
            <h2 class="p-0 mx-0 mt-3 fw-bold">What To Do When You Detect Unauthorized Transactions On Your Bank Card?</h2>
            </div>
          </Col>
          <Col sm={12} md={3} lg={3}>
            <h1>ads</h1>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default SpiceINLanding;
